import {useState} from "react";
import "./App.css";

// import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
// // import {faPencilAlt, faTrash} from "@fortawesome/free-solid-svg-icons";
// import {faTrash} from "@fortawesome/free-solid-svg-icons";
import InneliggandePatienter from "./Tabell/InneliggandePatienter";
import NyPatientForm from "./Formular/NyPatientForm";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "2023-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "2023-10-10", fvk: "MD"},
  ]);
  //  state för ny patient - start in = input
  const [inPlats, setInPlats] = useState("");
  const [inDatum, setInDatum] = useState("");
  const [inKontakt, setInKontakt] = useState("");

  //  state för redigering
  const [redigeradPatient, setRedigeradPatient] = useState(null);

  //funktioner som ska vara i appen
  const uniqueId = () => {
    return new Date().getTime(); // Ersätt med din egen unika ID-genereringslogik
  };

  const handleSubmitNypatient = (e) => {
    e.preventDefault();
    const nyPatient = {
      id: uniqueId(),
      plats: inPlats,
      datum: inDatum,
      fvk: inKontakt,
    };
    setPatienter((prevPatienter) => [...prevPatienter, nyPatient]);
    setInPlats("");
    setInDatum("");
    setInKontakt("");
  };

  const startRedigering = (patient) => {
    // kopiera patientobjekt
    setRedigeradPatient({...patient});
  };

  const sparaRedigering = () => {
    if (redigeradPatient) {
      setPatienter((prevPatienter) => {
        return prevPatienter.map((patient) => {
          return patient.id === redigeradPatient.id
            ? redigeradPatient
            : patient;
        });
      });
      setRedigeradPatient(null);
    }
  };

  const deletePatient = (id) => {
    setPatienter((prevPatienter) => {
      return prevPatienter.filter((p) => p.id !== id);
    });
  };

  return (
    <div className="App">
      <h1>Teest</h1>
      <br />

      {/* ny patient form - start */}
      {/* <div className="card">
        <form onSubmit={handleSubmitNypatient}>
          <div className="form-container">
            <div className="va-container">
              <input
                type="text"
                value={inPlats}
                onChange={(e) => setInPlats(e.target.value)}
              />
              <input
                type="text"
                value={inKontakt}
                onChange={(e) => setInKontakt(e.target.value)}
              />
              <input />
            </div>
            <div className="ho-container">
              <input
                type="date"
                value={inDatum}
                onChange={(e) => setInDatum(e.target.value)}
              />
              <input />
              <input />
            </div>
          </div>
          <div className="btn-container">
            <button type="submit">Spara</button>
          </div>
        </form>
      </div> */}
      <NyPatientForm
        handleSubmitNypatient={handleSubmitNypatient}
        inPlats={inPlats}
        setInPlats={setInPlats}
        inKontakt={inKontakt}
      />
      <InneliggandePatienter
        patienter={patienter}
        redigeradPatient={redigeradPatient}
        setRedigeradPatient={setRedigeradPatient}
        sparaRedigering={sparaRedigering}
        startRedigering={startRedigering}
        deletePatient={deletePatient}
      />
    </div>
  );
}

export default App;
